import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav>
      <ul className="navbar">
        <li>
          <Link to={"/"}>Home Page</Link>
        </li>
        <li>
          <Link to={"/OrderPage"}>Order</Link>
        </li>
        <li>
          <Link to={"/StoresPage"}>Store</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
